import React, { Component} from 'react';
import { Query} from 'react-apollo';
import query from './query'

function User() {
    return (<div>
        <Query query={query}>
            {({data}) => {
                <div>{data}</div>
            }}
        </Query>
    </div>);
}

export default User;
